// src/components/Header.js
import React, { useState } from 'react';
import './Header.css';

function Header() {
  const [darkMode, setDarkMode] = useState(true);

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
    document.body.classList.toggle('light-mode');
  };

  return (
    <header className="header">
      <nav className="nav">
        <ul className="nav-list">
          <li className="nav-item"><a href="#about">About</a></li>
          <li className="nav-item"><a href="#contact">Contact</a></li>
        </ul>
      </nav>
      <div className="profile">
        <img src="path-to-your-headshot" alt="Calvin Nguyen" className="headshot" />
        <h1>Calvin Nguyen</h1>
        <div className="social-links">
          <a href="https://www.linkedin.com/in/calvin-n-990a4a193" target="_blank" rel="noopener noreferrer">
            <img src="path-to-linkedin-logo" alt="LinkedIn" className="social-icon" />
          </a>
          <a href="https://github.com/narucalo" target="_blank" rel="noopener noreferrer">
            <img src="path-to-github-logo" alt="GitHub" className="social-icon" />
          </a>
        </div>
      </div>
      <button className="dark-mode-toggle" onClick={toggleDarkMode}>
        {darkMode ? 'Light Mode' : 'Dark Mode'}
      </button>
    </header>
  );
}

export default Header;
